import {Column} from "./column/Column";
import css from './board.module.scss';

export const Board = () => {
	const {states} = useTasks()
    return (
        <div className={css.board}>
            {states.map(
                (state, index) =>{
									console.log(state.title)
									return (<Column 
										key={index}
										id={state.id}
										title={state.title}
										state={state.state} 
									/>)
							}
            )}
        </div>
    )
}
